import React from "react";
import Member from "./member/member"

const Team = props =>{
    member = [{src:"null",name:"Jone Dow"},{src:"null",name:"anonymous"}];

    return (
        member.array.forEach(element => {
            <Member src = {element.src} name = {element.name}/>
        })
    )
}

export default Team;
